INSERT INTO `articles` VALUES (5,'Chợ Bến Thành là một ngôi chợ nằm tại quận 1, Thành phố Hồ Chí Minh. Chợ được khởi công xây dựng từ năm 1912, hình ảnh đồng hồ ở cửa nam của ngôi chợ này được xem là biểu tượng không chính thức của Thành phố Hồ Chí Minh. Chợ nằm giữa các đường Phan Bội Châu - Phan Chu Trinh - Lê Thánh Tôn - Công trường Quách Thị Trang tại phường Bến Thành với diện tích 13.056 m². Các ngành hàng kinh doanh chủ yếu ở đây bao gồm: quần áo, vải sợi, giày dép, thời trang, hàng thủ công mỹ nghệ, thực phẩm tươi sống, trái cây, hoa tươi,... Thời kì đầu của những năm thành lập, chợ Bến Thành đã có từ trước cả khi người Pháp xâm chiếm Gia Định. Ban đầu, vị trí của chợ nằm bên bờ sông Bến Nghé, cạnh một bến sông gần thành Gia Định (bấy giờ là thành Quy, còn gọi là thành Bát Quái). Bến này dùng để cho hành khách vãng lai và quân nhân vào thành, vì vậy mới có tên gọi là Bến Thành, và khu chợ cũng có tên gọi là chợ Bến Thành - tên gọi chính thức vẫn được sử dụng cho đến ngày nay.','2022-05-05','data:image/jpeg;base64,',1,'https://www.youtube.com/watch?v=FaL7V4FLF44',2,11,1,'Chợ Bến Thành','10.773690','106.698270',10),(6,'Dinh Độc Lập là một tòa dinh thự tại Thành phố Hồ Chí Minh, từng là nơi ở và làm việc của Tổng thống Việt Nam Cộng hòa trước Sự kiện 30 tháng 4 năm 1975. Hiện nay, dinh đã được Chính phủ Việt Nam xếp hạng là di tích quốc gia đặc biệt.','2022-06-06','/dataImages/baiViet/dinhDocLap.jpg',1,'https://www.youtube.com/watch?v=5rEmEVJo7as',1,8,1,'Dinh Độc Lập','10.777226060600944','106.69528063856295',20),(7,'Nhà thờ chính tòa Đức Bà Sài Gòn (hay Vương cung thánh đường chính tòa Đức Mẹ Vô nhiễm Nguyên tội, tiếng Anh: Immaculate Conception Cathedral Basilica, tiếng Pháp: Cathédrale Notre-Dame de Saïgon), thường được gọi tắt là Nhà thờ Đức Bà, là nhà thờ chính tòa của Tổng giáo phận Sài Gòn.[2]\n\nNhà thờ không chỉ là biểu tượng của Công giáo ở Việt Nam, mà còn là một trong những công trình kiến trúc độc đáo của Thành phố Hồ Chí Minh và điểm đến nổi tiếng với du khách.[3] Tên gọi ban đầu của nhà thờ là Nhà thờ Sài Gòn (tiếng Pháp: l\'eglise de Saïgon), tên gọi Nhà thờ Đức Bà bắt đầu được sử dụng từ năm 1959 bằng việc đặt Tượng Đức Bà Hòa Bình trước khuôn viên.\n\nNhà thờ là nơi tấn phong nhiều giám mục, đón tiếp các đại diện Tòa thánh Rôma, nhậm chức của các Tổng giám mục và cũng là nơi thụ phong của hàng ngàn linh mục.\nNhà thờ đầu tiên\nNgay sau khi chiếm Sài Gòn, thực dân Pháp đã cho lập ngôi nhà thờ dùng chỗ cử hành Thánh lễ cho người theo đạo Công giáo. Ngôi nhà thờ đầu tiên được lập ở đường Số 5 (nay là đường Ngô Đức Kế). Giám mục Lefevre quyết định xây dựng một nhà thờ. Vì nhà thờ đầu tiên đó quá nhỏ nên vào năm 1863, Đô đốc Victor Auguste Duperré đã quyết định cho khởi công xây dựng ở nơi khác một nhà thờ khác bằng gỗ bên bờ \"Kinh Lớn\" (còn gọi là kinh Charner, thời Việt Nam Cộng hòa là vị trí trụ sở Tòa Tạp tụng, tương ứng với vị trí tòa nhà Sun Wah ngày nay). Cố đạo Lefebvre tổ chức lễ đặt viên đá đầu tiên xây dựng nhà thờ vào ngày 28 tháng 3 năm 1863. Nhà thờ được dựng bằng gỗ, hoàn thành vào năm 1865, ban đầu gọi là Nhà thờ Saigon. Về sau, do nhà thờ gỗ này bị hư hại nhiều vì các côn trùng gây hại như mối và mọt gỗ, các buổi lễ được tổ chức trong phòng khánh tiết của Dinh Thống Đốc cũ, về sau cải thành trường học Lasan Taberd, cho đến khi nhà thờ lớn xây xong.','2018-12-31','/dataImages/baiViet/nhaThoDucBa.jpg',0,'https://www.youtube.com/watch?v=cDfS1QHMJUw',1,8,1,'Nhà thờ đức bà','106.69898670972752','10.78000681894851',0),(8,'Bảo tàng Lịch sử Việt Nam, cùng với Bảo tàng Cách mạng Việt Nam là hai bảo tàng đã được sáp nhập thành Bảo tàng Lịch sử quốc gia, tọa lạc ở thành phố Hà Nội. Bảo tàng Lịch sử Việt Nam (cũ) là nơi lưu giữ những hiện vật, phản ánh các nền văn hóa, lịch sử d','2022-08-08','/dataImages/baiViet/baoTangLichSuVietName2.jpg',1,'https://www.youtube.com/watch?v=hDxMsEaLgoQ',1,15,1,'Bảo tàng lịch sử Việt Nam','10.78890184446407','106.70472658193842',0),(9,'Địa đạo Củ Chi là một hệ thống phòng thủ trong lòng đất ở huyện Củ Chi, cách Thành phố Hồ Chí Minh 70 km về hướng tây-bắc. Hệ thống này được quân kháng chiến Việt Minh và Mặt trận Dân tộc Giải phóng miền Nam Việt Namđào trong thời kỳ Chiến tranh Đông Dương và Chiến tranh Việt Nam. Hệ thống địa đạo bao gồm bệnh xá, nhiều phòng ở, nhà bếp, kho chứa, phòng làm việc, hệ thống đường ngầm dưới lòng đất, dài khoảng 250 km và có các hệ thống thông hơi tại vị trí các bụi cây. Địa đạo Củ Chi được xây dựng ở điểm cuối Đường mòn Hồ Chí Minh, trên vùng đất được mệnh danh là \"đất thép\" để ca ngợi ý chí phòng thủ kiên cường của quân dân nơi đây. Trong Chiến dịch Tết Mậu Thân 1968, quân Giải phóng miền Nam đã xuất phát từ hệ thống địa đạo này để tấn công vào Sài Gòn.','2022-09-09','/dataImages/baiViet/diaDaoCuChi.jpg',1,'https://www.youtube.com/watch?v=WOp81pE7PEU',1,16,1,'Địa đạo Củ Chi','11.143514074434606','106.461428559136',0),(10,'Đường Nguyễn Huệ là một tuyến đường tại Quận 1, trung tâm Thành phố Hồ Chí Minh, chạy từ Trụ sở Ủy ban nhân dân Thành phố đến Bến Bạch Đằng, bờ sông Sài Gòn.[1] Hiện nay chính giữa con đường này là một quảng trường đi bộ rộng 27 m được đưa vào sử dụng từ ','2022-10-10','/dataImages/baiViet/phoDiBoNguyenHue.jpg',1,'https://www.youtube.com/watch?v=IhFMp92I2V8',1,17,1,'Phố đi bộ Nguyễn Huệ','10.774075242462143','106.70357579438587',0),(152,'content',NULL,'image',0,'title',1,8,1,'Kế hoạch du lịch','latitude','longitude',12),(252,'fdsfds',NULL,NULL,0,NULL,1,8,1,'maisssseeee',NULL,NULL,0);
